import React from "react";
import { Box, Typography } from "@mui/material";
import ValidationKPIs from "./ValidationKPIs";

function Validation() {
  return (
    <Box>
      <Typography variant="h5" fontWeight={600} mb={2}>Reasons Validation</Typography>
      <ValidationKPIs />
    </Box>
  );
}

export default Validation;
